import React from 'react';
import Email from './images/envelope-open.svg';
import Telephone from './images/telephone-inbound.svg';
import Likes from './images/suit-heart.svg';
import './navbar.css';
import Logo from './images/logo.png'
// import { Link } from "react-router-dom";
import { BrowserRouter as Router, Route, Link } from 'react-router-dom';

const NavBar = () => {
    function contactMethods() {
        return (
            <div style={{ display: 'flex', justifyContent: 'space-between', backgroundColor: '#333333', color: 'white' }}>
                <div style={{ display: 'flex' }}>
                    <div className='change-on-hover'>
                        <span><img src={Email} className='svg-image' /> SALES@RENTAWARE.COM</span>
                    </div>

                    <span>  |  </span>

                    <div className='change-on-hover'>
                        <span><img src={Telephone} className='svg-image' /> +65 8936 3356</span>
                    </div>
                </div>

                <div className='change-on-hover'>
                    <span><img src={Likes} className='svg-image' /> My Wishlist</span>
                </div>
            </div>
        )
    }

    function mainNavbar() {
        return (
            <div className='main-navbar-layout'>
                <Link className=''>
                    <p>Cook</p>
                </Link>

                {/*include Link to Homepage App.js*/}
                <img src={Logo} />


            </div>
        )
    }

    return (
        <div>
            {contactMethods()}
            {mainNavbar()}
        </div>
    )
}

export default NavBar;
